import "./App.css";
import Main from "./Main";
import { createBrowserRouter } from "./react-router-dom";

function App() {
  // const user = {
  //   name: "Shivraj",
  //   profilePicture: "https://example.com/profile.jpg",
  // };
  const router = createBrowserRouter([
    {
      path: "/",
      element: <Main />,
    },
  ]);
  return (
    <>
      <Main />
    </>
  );
}

export default App;
